import React from "react";

const Projects = () => {
  return (
    <div className="mt-32 bg-[#E6DACE] pb-20">
      <div className=" w-[43rem] my-0 mx-auto">
        <div className="flex items-center justify-center gap-3 pt-20 pb-16">
          <div className="w-5 h-5 bg-blue-800"></div>
          <h1 className=" text-3xl font-bold tracking-wide">PROJECTS</h1>
        </div>

        <p>
          Projects I'm a paragraph. Click here to add your own text and edit me.
          It's easy. Just click “Edit Text” or double click me to add your own
          content and make changes to the font. I'm a great place for you to
          tell a story and let your users know a little more about you.
        </p>

        <div className="flex flex-col gap-3">
          <div className="drop-shadow-2xl bg-white flex flex-col gap-10 justify-center items-center mt-16 h-[22rem]"></div>
          <div className="drop-shadow-2xl bg-white flex flex-col gap-10 justify-center items-center px-20 py-10  h-[22rem]"></div>
          <div className="drop-shadow-2xl bg-white flex flex-col gap-10 justify-center items-center px-20 py-10 my-12 h-[22rem]"></div>
        </div>
      </div>
    </div>
  );
};

export default Projects;
